export enum TaskStatusEnum {
  ToDo = 'ToDo',
  InProgress = 'InProgress',
  Done = 'Done',
}

export enum ETaskStatus {
  'ToDo' = 'ToDo',
  'InProgress' = 'InProgress',
  'Done' = 'Done',
}
